script: |
  super -f text -I q10005.spq | sort > q10005.out

inputs:
  - name: q10005.spq
    data: |
      SELECT + + 8 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 / + 61 BETWEEN - + ( + col1 ) + + - ( + + col0 ) * - - col2 + + 82 AND NULL;
  - name: tab1

outputs:
  - name: q10005.out
    data: |
